import logo from './logo.svg';
import './App.css';
import React from 'react';
import Background from "https://framer.com/m/Background-wT6L.js@rDVhA0DuoO5SDMKVUfSj"

function App() {
  return (
    <Background>
      <div style = {{marginTop: 200, textAlign: 'center'}}>
        <h1 style = {{fontSize: 80, fontFamily:'Syne'}}>Hi, I'm <br/> Eashan Mathur</h1>
        <p style = {{fontSize: 30, fontFamily: 'Manrope'}}>Senior at the University of California, Berkeley. <br/>iOS Developer and Designer.</p>
      </div>
    </Background>

  );
}

export default App;
